window.bookSummaryJSON = "<p><b>With over 10 million copies sold, The Expanse has become one of the biggest science fiction phenomenons of the decade. The sixth book in the </b><b><i>NYT</i></b><b> bestselling Expanse series, </b><b><i>Babylon's Ashes</i></b><b> has the galaxy in full revolution, and it's up to the crew of the </b><b><i>Rocinante</i></b><b> to make a desperate mission to the gate network and thin hope of victory.<br> <br> Now a Prime Original series.</b><br> <br> <b>HUGO AWARD WINNER FOR BEST SERIES</b><br> ​<br> A revolution brewing for generations has begun in fire. It will end in blood.<br> <br> The Free Navy -- a violent group of Belters in black-market military ships -- has crippled the Earth and begun a campaign of piracy and violence among the outer planets. The colony ships heading for the thousand new worlds on the far side of the alien ring gates are easy prey, and no single navy remains strong enough to protect them.<br> <br> James Holden and his crew know the strengths and weaknesses of this new force better than anyone. Outnumbered and outgunned, the embattled remnants of the old political powers call on the <i>Rocinante</i> for a desperate mission to reach Medina Station at the heart of the gate network.<br> <br> But the new alliances are as flawed as the old, and the struggle for power has only just begun.<br> <br> <i>Babylon's Ashes </i>is a breakneck science fiction adventure following the bestselling <i>Nemesis Games</i>.<br> <br> <b>The Expanse</b><br> <i>Leviathan Wakes<br> Caliban's War<br> Abaddon's Gate<br> Cibola Burn<br> Nemesis Games<br> Babylon's Ashes<br> Persepolis Rising<br> Tiamat's Wrath<br> ​Leviathan Falls<br> <br> Memory's Legion</i><br> <br> <b>The Expanse Short Fiction</b><br> <i>Drive<br> The Butcher of Anderson Station</i><br> <i>Gods of Risk</i><br> <i>The Churn</i><br> <i>The Vital Abyss</i><br> <i>Strange Dogs</i><br> <i>Auberon<br> The Sins of Our Fathers</i></p>"; 
